webpackJsonp([98402527300606],{418:function(e,i){e.exports={data:{markdownRemark:{html:'<p>The invalid-aria-prop warning will fire if you attempt to render a DOM element with an aria-* prop that does not exist in the Web Accessibility Initiative (WAI) Accessible Rich Internet Application (ARIA) <a href="https://www.w3.org/TR/wai-aria-1.1/#states_and_properties">specification</a>.</p>\n<ol>\n<li>\n<p>If you feel that you are using a valid prop, check the spelling carefully. <code>aria-labelledby</code> and <code>aria-activedescendant</code> are often misspelled.</p>\n</li>\n<li>\n<p>React does not yet recognize the attribute you specified. This will likely be fixed in a future version of React. However, React currently strips all unknown attributes, so specifying them in your React app will not cause them to be rendered</p>\n</li>\n</ol>',frontmatter:{title:"Invalid ARIA Prop Warning",next:null,prev:null},fields:{path:"warnings/invalid-aria-prop.md",slug:"warnings/invalid-aria-prop.html"}}},pathContext:{slug:"warnings/invalid-aria-prop.html"}}}});
